import React from 'react';


const Nav = () => {
    
    return (
        <header>
            <h1>Playlist</h1>
            <nav>
                <h3 to='/'>Home</h3>
                <h3 to='/About'>About</h3>
            </nav>
        </header>
    )
}

export default Nav;
